import React, {Component} from 'react';
import {Layout, Header, Navigation,Content} from 'react-mdl';
import './landingPage.css';
import {Navbar, Form, FormControl, Button} from 'react-bootstrap';


class LandingPage extends Component {
    render(){
        return (
            <div style={{height: '500px', position: 'relative'}}>
    <Layout style={{background: 'url(https://images.ctfassets.net/pjnu85utzlm3/1dG0B1I5UxkLpauORKuSVB/fe9e167656ebe99692619c37ca6624f6/nastuh-abootalebi-eHD8Y1Znfpk-unsplash.jpg) center / cover'}}>
        <Header transparent title="Find Any contractor that you want" style={{color: 'white'}}>
            <Navigation>
                <a href="Home">Link</a>
                <a href="Categories">Link</a>
                <a href="Find Contractor">Link</a>
                <a href="Contact">Link</a>
            </Navigation>
        </Header>
        <Content />
        <Navbar bg="primary" variant="dark">
    <Navbar.Brand href="#home">Explore</Navbar.Brand>
    <Form inline>
      <FormControl type="text" placeholder="Search" className="mr-sm-2" />
      <Button variant="outline-light">Search</Button>
    </Form>
  </Navbar>
  
    </Layout>

 </div>
    
        )
    }
}

export default LandingPage;
